import React, {Component} from 'react';
import {DetailWrap, Header} from './style';

class Detail extends Component {
    render(){
        console.log(this.props.match.params.id);
        return (
            <DetailWrap>
                <Header>请记住杨绛先生的这4句话（深度文字）</Header>
            </DetailWrap>
        )
    }
}

export default Detail;
